	static public int lengthOfLongestSubstring(String s) {
		char[] c = s.toCharArray();
		int[] mark = new int[128];
		resetMarkBefore(mark, 0);
		int longestCt = 0;
		int startIndex = 0;
		int ct = 0;

		for(int i = 0; i < c.length; i++){
			if(mark[c[i]] == -1){
				mark[c[i]] = i;
				ct++;
			}else{
				if(ct > longestCt){
					longestCt = ct;
				}
				ct = i - mark[c[i]];
				resetMarkBefore(mark, mark[c[i]]);
				mark[c[i]] = i;
			}
		}

		return ct > longestCt ? ct : longestCt;
	}

	static public String longestSubstring(String str){
		char[] c = str.toCharArray();
		int[] mark = new int[128];
		resetMarkBefore(mark, 0);
		int longestCt = 0;
		int startIndex = 0;
		int longestStartIndex = -1, longestEndIndex = -1;
		int ct = 0;

		for(int i = 0; i < c.length; i++){
			if(mark[c[i]] == -1){
				mark[c[i]] = i;
				ct++;
			}else{
				if(ct > longestCt){
					longestCt = ct;
					longestStartIndex = startIndex;
					longestEndIndex = i - 1;
				}
				ct = i - mark[c[i]];
				startIndex = mark[c[i]] + 1;
				resetMarkBefore(mark, mark[c[i]]);
				mark[c[i]] = i;
			}
		}

		if(ct > longestCt){
			longestStartIndex = startIndex;
			longestEndIndex = c.length - 1;
		}

		return new String(c, longestStartIndex, longestEndIndex - longestStartIndex + 1);
	}

	static private int[] resetMarkBefore(int[] mark, int index){
		for(int i = 0; i < mark.length; i++){
			if(mark[i] <= index){
				mark[i] = -1;
			}
		}
		return mark;
	}
